import {
    StyleSheet,
    Text,
    View,
  } from "react-native";
export default function CollectionItem({ num, items }) {
  return (
    <View style={styles.item}>
      <Text>Collection name {num}</Text>
      <Text>No. of items:{items}</Text>
    </View>
  );
}

const styles = StyleSheet.create({
    item:{
        // flex:1,
        borderWidth:1,
        height:50,
        marginTop:5,
        marginBottom:5,
        padding:5,
        display:"flex",
        justifyContent:"space-between",
        borderRadius:10,
      },
});
